let configs = configuration;



if(response_headers !== null 
	|| !response_iserror) {	
			configs['gooddata.supersecure.token'] = response_headers['X-GDC-AuthSST'];
			configs['gooddata.temporary.token'] = response_headers['X-GDC-AuthTT'];
		}

if (response_body.profile){
	let profileId = response_body.profile.slice(21);
	configs.userId = profileId;
}

done({
	"continue": true,
	"configuration": configs
})

//console.log(JSON.stringify(configuration));
let configs = configuration;
if (response_iserror) {
    done();
} else if (response_body === null) {
    done();
} else {
    let arrayResponse = response_body;
    let id;
    let found = 0;
    for (let i = 0; i < arrayResponse.length; i++) {
        let map = arrayResponse[i];
        if (map.title === configs['folder.name']) {
            id = getFolderId(map);
            configs['folder.id'] = id;
            found = 1;
        }
    }
    if (found === 0) {
        done({
            "response_body": { "error": "Folder name not found" },
            "response_status_code": 400
        });
    } else {
        done({
            "configuration": configs
        });
    }
}

function getFolderId(map) {
    let links = map.link;
    return links.split("/")[5];
}

//console.log(JSON.stringify(configuration));
if (response_iserror) {
    done();
} else {
    let arrayResponse = response_body;
    let listWrapper = [];
    for (let i = 0; i < arrayResponse.length; i++) {
        let map = arrayResponse[i];
        if (map.link) {
            let id = getFolderId(map);
            map["id"] = id;
        }
        listWrapper.push(map);
    }
    done({
        "response_body": listWrapper
    });
}

function getFolderId(map) {
    let link = map.link;
    return link.split("/")[5];
}

let configs = configuration;
if (response_iserror) {
	done();
} else if (response_body === null) {
	done({
		"response_body" : { "error": "Null response" },
		"response_status_code": 401
	});
} else {
	let arrayResponse = response_body;
	let listWrapper = [];
	let id;
	let found = 0;
	for (let i = 0; i < arrayResponse.length; i++) {
		let map = arrayResponse[i];
		if (map.project.meta.title === configs['project.name']) {
			id = getProjectId(map);
			configs['project.id'] = id;
			found = 1;
		}
		map.project.meta["id"] = getProjectId(map);
		listWrapper.push(map);
	}
	if (found === 0) {
		done({
			"response_body" : { "error": "Project name not found"},
			"response_status_code": 401
		});
	} else {
		done({
			"response_body": listWrapper,
			"configuration" : configs
		});
	}
}

function getProjectId(map) {
	let links = map.project.links.self;
	return links.split("/")[3];
}

